import { useState } from 'react';
const Counter = () => {

    const [Mycount, setMycount] = useState(0);

    const increment = () =>{

        setMycount = (Mycount+1);


    }

    return (  

       <div className="counter_box">

            <div className='count'>{Mycount}</div>
            <div className='count_action'>
                <button className='btn-large' onClick={increment}>Increment</button>
                <button className='btn-large'>Decrement</button>
                <button className='btn-large'>Reset</button>
            </div>

       </div>       

    );
}

export default Counter ;
